import Form from "./Form";
import Invoice from "./Invoice";
import { BrowserRouter, Route } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <div>
        <Form/>
        <Route path="/invoice" exact component={Invoice} />
      </div>
      </BrowserRouter>

    </div>
  );
}

export default App;
